using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace AdventCode.Day5
{
    public class Worker
    {
        private HashSet<string> _reactMap = new HashSet<string> { "Aa", "aA", "Bb", "bB", "Cc", "cC", "Dd", "dD", "Ee", "eE", "Ff", "fF", "Gg", "gG", "Hh", "hH", "Ii", "iI", "Jj", "jJ", "Kk", "kK", "Ll", "lL", "Mm", "mM", "Nn", "nN", "Oo", "oO", "Pp", "pP", "Qq", "qQ", "Rr", "rR", "Ss", "sS", "Tt", "tT", "Uu", "uU", "Vv", "vV", "Ww", "wW", "Xx", "xX", "Yy", "yY", "Zz", "zZ" };

        public int Work1()
        {
            string input = _input;
            string output = ReactTillEnd(input);
            return output.Length;
        }       

        public int Work2()
        {
            int minLength = int.MaxValue;

            int i = 0;
            foreach (string unit in _reactMap)
            {
                if (i % 2 == 1)
                {
                    i++;
                    continue;
                }

                string reduced = RemoveUnit(_input, unit.Substring(0, 1), unit.Substring(1, 1));
                string reacted = ReactTillEnd(reduced);

                if (reacted.Length < minLength)
                    minLength = reacted.Length;

                i++;
            }

            return minLength;
        }

        private string RemoveUnit(string input, string upper, string lower)
        {
            string reduced = input.Replace(upper, "");
            reduced = reduced.Replace(lower, "");
            return reduced;
        }

        private string ReactTillEnd(string input)
        {
            string output = "";
            while (input.Length != 0)
            {
                output = React(input);

                if (output.Length == input.Length)
                    break;
                else
                    input = output;
            }
            return output;
        }

        private string React(string input)
        {
            string reacted = input;
            char previous = reacted[0];
            char current;

            for (int i = 1; i < reacted.Length; i++)
            {
                current = reacted[i];

                string unit = $"{previous}{current}";
                if (_reactMap.Contains(unit))
                {
                    reacted = reacted.Replace(unit, "");

                    if (i >= reacted.Length)
                        break;

                    previous = reacted[i];
                    continue;
                }

                previous = current;
            }
            return reacted;
        }

        string _testInput = @"dabAcCaCBAcCcaDA";

        string _input = @"";
    }
}
